#include "ros/ros.h"
#include <iostream>
#include <db_client/DbClient.hpp>
#include <vector>
#include <cstdint>
#include <thread>

#define SLP_TIME 20.0f

std::unique_ptr<db_client::DbClient> db;

void slp(double secs)
{
    ros::Duration(secs).sleep();
}

uint64_t getTs()
{
    return ros::Time::now().toNSec() / 1000000;
}

void insertData(uint16_t robotId, uint16_t dataType, std::string data)
{
    slp((double)(rand() % 51 + 7000) / 1000);
    
    uint16_t eid = (robotId * 1000) + dataType;
    uint64_t ts = getTs();
    if (db->upsert({db_client::DbClient::Schema(eid, ts, data + " - " + std::to_string(ts))}))
    {
        std::ostringstream oss;
        oss << "Inserted " << eid << " with timestamp " << ts;
        ROS_INFO("%s", oss.str().c_str());
    }
}

std::unique_ptr<std::thread> testOne(uint16_t robotId, uint16_t dataType, std::string data)
{
    std::unique_ptr<std::thread> ptr = std::unique_ptr<std::thread>(new std::thread(insertData, robotId, dataType, data));
    return ptr;
}

void assertOne(uint16_t robotId, uint16_t dataType, std::string data)
{
    uint16_t eid = (robotId * 1000) + dataType;
    auto sch = db->selectSchema(eid);
    if (sch)
    {
        if ((sch->data.find(std::to_string(sch->timestamp)) != std::string::npos) && (sch->data.find(data) != std::string::npos))
        {
            ROS_INFO("SEEN entry ID %u with timestamp %lu", sch->id, sch->timestamp);
        }
        else
        {
            ROS_ERROR("Entry ID %u with timestamp %lu has WRONG data", sch->id, sch->timestamp);
        }
    }
    else
    {
        ROS_ERROR("MISSING entry ID %u", eid);
    }
}

int main(int argc, char** argv)
{
    ros::init(argc, argv, "db_test_node");
    ros::NodeHandle nh;
    uint16_t robotId;

    std::string ns = ros::this_node::getNamespace();
    if (ns == "")
    {
        ROS_ERROR("No ROS namespace, exiting.");
        exit(-1);
    }
    else
    {
        ns = ns.substr(1);
    }
    
    if (ns == "X1")
    {
        robotId = 1;
    }
    else if (ns == "X2")
    {
        robotId = 2;
    }
    else
    {
        robotId = 3;
    }

    db = std::unique_ptr<db_client::DbClient>(new db_client::DbClient(ns));
    std::string mbStr;
    for (int i = 0; i < 150000; i++)
    {
        mbStr.append("m");
    }

    // Insert REALLY LONG data
    auto test1 = testOne(robotId, 1, "");
    auto test2 = testOne(robotId, 2, "");
    auto test3 = testOne(robotId, 3, "");
    auto test4 = testOne(robotId, 4, "");
    // auto test5 = testOne(robotId, 5, "");
    // auto test6 = testOne(robotId, 6, "");;
    auto test7 = testOne(robotId, 7, mbStr);
    // auto test8 = testOne(robotId, 8, mbStr);
    if (test1->joinable())
    {
        test1->join();
    }
    if (test2->joinable())
    {
        test2->join();
    }
    if (test3->joinable())
    {
        test3->join();
    }
    if (test4->joinable())
    {
        test4->join();
    }
    // if (test5->joinable())
    // {
    //     test5->join();
    // }
    // if (test6->joinable())
    // {
    //     test6->join();
    // }
    if (test7->joinable())
    {
        test7->join();
    }
    // if (test8->joinable())
    // {
    //     test8->join();
    // }

    // Database should be synced by now.
    slp(SLP_TIME);

    // Test that same data exists.
    assertOne(1, 1, "");
    assertOne(1, 2, "");
    assertOne(1, 3, "");
    assertOne(1, 4, "");
    // assertOne(1, 5, "");
    // assertOne(1, 6, "");
    assertOne(1, 7, mbStr);
    // assertOne(1, 8, mbStr);
    assertOne(2, 1, "");
    assertOne(2, 2, "");
    assertOne(2, 3, "");
    assertOne(2, 4, "");
    // assertOne(2, 5, "");
    // assertOne(2, 6, "");
    assertOne(2, 7, mbStr);
    // assertOne(2, 8, mbStr);
    assertOne(3, 1, "");
    assertOne(3, 2, "");
    assertOne(3, 3, "");
    assertOne(3, 4, "");
    // assertOne(3, 5, "");
    // assertOne(3, 6, "");
    assertOne(3, 7, mbStr);
    // assertOne(3, 8, mbStr);
}    
